import {
  PuppeteerPdfGenerator
} from '../../../../../src/Contexts/Printer/Pdf/infrastructure/services/PuppeteerPdfGenerator';
import { mock } from 'ts-mockito';
import Logger from '../../../../../src/Contexts/Shared/domain/Logger';
import fs from 'fs';
import { WebClientFactory } from '../../../../../src/Contexts/Printer/Pdf/infrastructure/services/WebClientFactory';
import { Browser } from 'puppeteer';


describe('PDF should be generated', () => {
  let webClient: Promise<Browser>;
  let logger = mock<Logger>();
  let sut: PuppeteerPdfGenerator;
  beforeAll(() => {
    webClient = WebClientFactory.client();
    logger = mock<Logger>();
    sut = new PuppeteerPdfGenerator(webClient, logger);
  });

  afterAll(async () => {
    await (await webClient).close();
  });
  test('should generate PDF event and file should exist', async () => {
    const path = './';
    const filename = 'test.pdf';

    const header = '<header>\n' +
      '       <img width="300" height="200"  src="data:image/jpeg;base64,"/>\n' +
      '</header>';

    const body = '<main class="content mt-5">\n' +
      '  <!-- Begin Header -->\n' +
      '  <div class="container">\n' +
      '    <div class="row">\n' +
      '      <div class="col">\n' +
      '        <h1>Body</h1>\n' +
      '      </div>\n' +
      '    </div>\n' +
      '  </div>\n' +
      '  </main>\n';
    const footer = '<footer>\n' +
      '    <div class="container">\n' +
      '        <div class="row">\n' +
      '            <div class="col">\n' +
      '                <p style="font-size:11px; font-family: Arial, Helvetica, sans-serif; color: #636464">\n' +
      '                    <strong>Footer</strong>\n' +
      '            </div>\n' +
      '        </div>\n' +
      '    </div>\n' +
      '</footer>\n';
    const options = {
      'options': {
        'puppeteer': {
          'margin': {}
        }
      }
    };
    const correlationId = 'correlationId';
    const messageId = 'messageId';
    await sut.generate(path, filename, header, body, footer, options, correlationId, messageId);
    expect(fs.existsSync(path + filename)).toBe(true);
    fs.unlinkSync(path + filename);
  });


});
